import React from 'react';
import './Hero.css';

function Hero() {
  return (
    <section className="hero">
      <img 
        src="/Fundal.png" 
        alt="Fundal Chef IT" 
        className="hero-background"
      />
      <div className="hero-content">
        <h1 className="hero-logo">
          chef <span>IT</span>
        </h1>
      </div>
    </section>
  );
}

export default Hero;
